import React from 'react';
import './Header.css';
import logo from './logo.png'
import { Link } from 'react-router-dom';


export const Header = () => {
  return (
      <header className="header">
          <div className="header-logo">
              <img src={logo} alt="Логотип"/>
          </div>
          <nav>
              <Link to="/about">О нас</Link>
          </nav>
      </header>
  );
};

export default Header;
